#pragma mark - UITableView Datasource

- (NSInteger)numberOfSectionsInTableView:(UITableView *)tableView {
    return 1;
}

- (NSInteger)tableView:(UITableView *)tableView numberOfRowsInSection:(NSInteger)section {
    return [self.contentArr count];
}

- (UITableViewCell *)tableView:(UITableView *)tableView cellForRowAtIndexPath:(NSIndexPath *)indexPath {
    static NSString *cellIdentifier = @"Cell";
    
    LJYCustomTableViewCell *cell = [tableView dequeueReusableCellWithIdentifier:cellIdentifier];
    
    cell.content = [self.contentArr objectAtIndex:indexPath.row];
//    NSLog(@"%d cell ðŸ’” ðŸ’” ðŸ’” ðŸ’” ðŸ’” ðŸ’”", indexPath.row);     // ðŸ’” ðŸ’™ ðŸ’š ðŸ’› ðŸ’œ ðŸ’¡ ðŸ’¢ ðŸ’£
    
    return cell;
}


#pragma mark - UITableView Delegate methods

- (CGFloat)tableView:(UITableView *)tableView heightForRowAtIndexPath:(NSIndexPath *)indexPath
{
    if ([self.contentArr count] >= indexPath.row) {
        CGRect rect = CGRectInset(self.view.bounds, 10, 10);
        
        
        LJYCustomAttributeString* aCS = [[LJYCustomAttributeString alloc] initWith:[self.contentArr objectAtIndex:indexPath.row] withWidth:rect.size.width];
        
        NSLog(@"%lf height ðŸ’” ðŸ’” ðŸ’” ðŸ’” ðŸ’” ðŸ’”", aCS.height);     // ðŸ’” ðŸ’™ ðŸ’š ðŸ’› ðŸ’œ ðŸ’¡ ðŸ’¢ ðŸ’£
        return aCS.height;
    }
    
    return 0;
}

